tables.table_schema:
CREATE TABLE proteins (
  protein_id INT PRIMARY KEY,
  protein_name VARCHAR(255) NOT NULL,
  function VARCHAR(255),
  gene_name VARCHAR(255)
);

CREATE TABLE Proteins(
    protein_id INT PRIMARY KEY,
    protein_name VARCHAR(255) NOT NULL,
    protein_sequence TEXT
);

CREATE TABLE ProteinComplexes(
    complex_id INT PRIMARY KEY,
    complex_name VARCHAR(255) NOT NULL,
    member_proteins TEXT
);

CREATE TABLE protein_complexes (
    complex_id INT PRIMARY KEY,
    complex_name VARCHAR(100),
    description TEXT
);

CREATE TABLE protein_annotations (
    annotation_id INT PRIMARY KEY,
    protein_id INT,
    annotation_text TEXT
);

CREATE TABLE interaction_scores (
    score_id INT PRIMARY KEY,
    interaction_id INT,
    score FLOAT
);
